import Vue from 'vue'
import App from './App.vue'
import router from './router'
import store from '../../vuex/store'
import {Table} from 'iview';
// import { Swipe, SwipeItem } from 'vue-swipe'  // 加这里
import VueAMap from "vue-amap";
import VCharts from 'v-charts'
import '../../assets/scss/my-theme.less';
import '../../assets/scss/style.scss';
import 'swiper/dist/css/swiper.css'
import '../../plugins/element.js';
import http   from '../../axios.js';
import api     from '../../api/apiBase.js'
import vuedraggable from 'vuedraggable';
import JsonExcel from 'vue-json-excel'
import * as custom from '../../assets/js/common/filters'
import cookie    from '../../assets/js/common/cookie'
import regular   from  '../../assets/js/common/regular'
import base64    from '../../assets/js/common/base64'
import longitude  from  '../../assets/js/common/longitude'
import array    from   '../../assets/js/common/array'
import format   from   '../../assets/js/common/formatDate'
import countDown   from '../../assets/js/common/countDown'
import dataManage   from  '../../assets/js/common/dataManage'
import cities    from   '../../assets/js/common/cities'
// import VideoPlayer from 'vue-video-player'
//
// require('video.js/dist/video-js.css')
//
// require('vue-video-player/src/custom-theme.css')
//
// Vue.use(VideoPlayer)
Vue.use(VueAMap);
Vue.use(VCharts);
Vue.component('downloadExcel', JsonExcel);

/**
 * ivew 按需引入组件
 */
Vue.component('Table',Table);
/**
 * 拖动组件
 */
Vue.component('vuedraggable',vuedraggable);

/**
 * 全局配置common方法
 */
Object.assign(Vue.prototype,{
    http,         //ajax封装的请求
    api,          //接口地址全局封装
    cookie,       //cookie存，删，
    regular,      //正则验证封装
    base64,       //base64加密封装
    longitude,    //经纬度与小数转换封装
    array,        //数组操作封装
    format,       //日期格式转换封装
    countDown,    //倒计时
    dataManage,   //数据管理
    cities
});

/**
 * 过滤器配置
 */
Object.keys(custom).forEach(key => {
    Vue.filter(key, custom[key])
});

Vue.config.productionTip = false;

new Vue({
    router,
    store,
    render: h => h(App)
}).$mount('#after');
